『マジカルカーボン』は本物のカーボン繊維を使用し、特許技術製法により「伸びるシートとして緩やかな曲面・段差にも貼り付け可能」にした商品です。<br>本物故の保護力に加え、スポーティ感・高級感を演出します。<br><br>車種専用カットタイプなので、各パーツの形状に合わせて加工されており、そのまま貼り付けるだけでOKです。<br><br><br>★ピラー専用のマジカルカーボンです。<br><br><br>【仕様】<br><br>■材質 ： マジカルカーボン<br>■適合車種 ： ロードスター ND5 H27.5～<br>■商品内容 ： マジカルカーボン ピラーセット<br>■カラー ： ブラック<br>■品番 ： CPMA-32<br>■メーカー ： HASEPRO / ハセプロ<br><br><br>※ご注文確定後にメーカーへオーダーする商品です。<br>※車種専用のマジカルカーボンシートのみの販売となります。<style type="text/css">
